const NasaCard = () => {

    useEffect(() => {
        axios
        .get()
        .then(success => {
            console.log('Success');
        })
        .catch(failure => {
            console.log('Failure');
        })
    }

    )






    return(
        <div className='nasa-card'>
            My NasaCard to be changed later
